fn discover_good_8_bits_f(f_10_bits: &str, previous_f: &Vec<BooleanFunction>) -> Option<String> {
    let boolean_function = boolean_function::boolean_function_from_hex_string_truth_table(f_10_bits).unwrap();
    let walsh = boolean_function.walsh_hadamard_values();
    let sub_walsh = walsh.iter().tuples()
        .map(|(i, j)| (i+j)/2)
        .collect::<Vec<i32>>();

    let mut sub_sub_walsh = sub_walsh.iter().tuples()
        .map(|(i, j)| (i + j) / 2)
        .collect::<Vec<i32>>();
    let first_zero = sub_sub_walsh.iter().position(|&x| x == 0)?;
    sub_sub_walsh.swap_remove(first_zero);


    let max_f = repeat(())
        .map(|_| {
            let mut rng = rand::thread_rng();
            let mut other_subsub_walsh = sub_sub_walsh.clone();
            other_subsub_walsh.shuffle(&mut rng);
            let other_walsh = [&[0], other_subsub_walsh.as_slice()].concat();
            let other_subsub_function = boolean_function::boolean_function_from_reverse_walsh_transform(&other_walsh).unwrap();
            other_subsub_function
        })
        .find_first(|f| f.is_balanced() && f.nonlinearity() > 100 && previous_f.iter().all(|p| (p.clone() ^ f.clone()).is_balanced()))
        .unwrap();
    Some(max_f.printable_hex_truth_table())
}
